import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <ul>
                <li><Link to="/"/>Goa</li>
                <li><Link to="/mountain"/>Mountain</li>
                <li><Link to="/beaches"/>Beaches</li>
                <li><Link to="/birds"/>Birds</li>
                <li><Link to="/food"/>Food</li>
            </ul>
        </nav>
        
     );
}
 
export default Navbar;
